import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

function AdminDashboardPage() {
  const API_URL = "http://localhost:5000/api";
  const [users, setUsers] = useState([]);
  const [addresses, setAddresses] = useState([]);
  const [orders, setOrders] = useState([]);
  const [carts, setCarts] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const email = localStorage.getItem("email");
    if (email !== "rngasseu123@gmail.com") {
      navigate("/login");
      return;
    }

    const fetchData = async () => {
      try {
        const [usersRes, addressesRes, ordersRes, cartsRes] = await Promise.all([
          fetch(`${API_URL}/users/admin`),
          fetch(`${API_URL}/addresses/admin`),
          fetch(`${API_URL}/orders/admin`),
          fetch(`${API_URL}/carts/admin`),
        ]);

        const usersData = await usersRes.json();
        const addressesData = await addressesRes.json();
        const ordersData = await ordersRes.json();
        const cartsData = await cartsRes.json();

        setUsers(usersData);
        setAddresses(addressesData);
        setOrders(ordersData);
        setCarts(cartsData);
      } catch (error) {
        console.error("Erreur lors de la récupération des données admin:", error);
      }
    };

    fetchData();
  }, [navigate]);

  return (
    <div>
      <h2>Dashboard Admin</h2>

      {/* Utilisateurs */}
      <section>
        <h3>Utilisateurs</h3>
        {users.length > 0 ? (
          users.map((user) => (
            <div key={user._id}>
              <p>{user.name} - {user.email}</p>
              <button onClick={() => handleEditUser(user)}>Modifier</button>
            </div>
          ))
        ) : (
          <p>Aucun utilisateur trouvé.</p>
        )}
      </section>

      {/* Adresses */}
      <section>
        <h3>Adresses</h3>
        {addresses.length > 0 ? (
          addresses.map((address) => (
            <div key={address._id}>
              <p>{address.street}, {address.city}</p>
              <button onClick={() => handleEditAddress(address)}>Modifier</button>
            </div>
          ))
        ) : (
          <p>Aucune adresse trouvée.</p>
        )}
      </section>

      {/* Commandes */}
      <section>
        <h3>Commandes</h3>
        {orders.length > 0 ? (
          orders.map((order) => (
            <div key={order._id}>
              <p>Commande #{order._id} - Total: {order.totalAmount} USD - Statut: {order.status}</p>
              <button onClick={() => handleEditOrder(order)}>Modifier</button>
            </div>
          ))
        ) : (
          <p>Aucune commande trouvée.</p>
        )}
      </section>

      {/* Paniers */}
      <section>
        <h3>Paniers</h3>
        {carts.length > 0 ? (
          carts.map((cart) => (
            <div key={cart._id}>
              <p>Panier #{cart._id} - Articles: {cart.items.length}</p>
              <button onClick={() => handleEditCart(cart)}>Modifier</button>
            </div>
          ))
        ) : (
          <p>Aucun panier trouvé.</p>
        )}
      </section>
    </div>
  );
}

// Fonctions de modification (pour l'instant juste console.log)
function handleEditUser(user) {
  console.log("Modifier utilisateur:", user);
}

function handleEditAddress(address) {
  console.log("Modifier adresse:", address);
}

function handleEditOrder(order) {
  console.log("Modifier commande:", order);
}

function handleEditCart(cart) {
  console.log("Modifier panier:", cart);
}

export default AdminDashboardPage;
